import './LandingStyles.css';
import { getTemperaments } from '../../actions';
import { useDispatch } from 'react-redux'

export default function LandingComponent () {
    return (
        <div className="bou">
            <Link exact to="/dogs" >
            <button type="button" onClick class="btn  btn-dark btn-lg noDecos ">
                Home
                </button>
                </Link>
        </div>
    )

       
}
